public class InnerGatewayRouteHttpGatewayRouteRewriteFactory(Action<Humidifier.AppMesh.GatewayRouteTypes.HttpGatewayRouteRewrite> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.GatewayRouteTypes.HttpGatewayRouteRewrite>
{

    internal InnerGatewayRouteHttpGatewayRoutePathRewriteFactory PathFactory { get; set; }

    internal InnerGatewayRouteGatewayRouteHostnameRewriteFactory HostnameFactory { get; set; }

    internal InnerGatewayRouteHttpGatewayRoutePrefixRewriteFactory PrefixFactory { get; set; }

    protected override Humidifier.AppMesh.GatewayRouteTypes.HttpGatewayRouteRewrite Create()
    {
        var httpGatewayRouteRewriteResult = CreateHttpGatewayRouteRewrite();
        factoryAction?.Invoke(httpGatewayRouteRewriteResult);

        return httpGatewayRouteRewriteResult;
    }

    private Humidifier.AppMesh.GatewayRouteTypes.HttpGatewayRouteRewrite CreateHttpGatewayRouteRewrite()
    {
        var httpGatewayRouteRewriteResult = new Humidifier.AppMesh.GatewayRouteTypes.HttpGatewayRouteRewrite();

        return httpGatewayRouteRewriteResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.GatewayRouteTypes.HttpGatewayRouteRewrite result)
    {
        base.CreateChildren(result);

        result.Path ??= PathFactory?.Build();
        result.Hostname ??= HostnameFactory?.Build();
        result.Prefix ??= PrefixFactory?.Build();
    }

} // End Of Class

